Here's a sample Spark job in Java that calculates the hit rate for the onsite attributed data based on the top frequent queries:

```java
import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.JavaSparkContext;
import org.apache.spark.api.java.function.Function;
import org.apache.spark.api.java.function.Function2;
import scala.Tuple2;

import java.io.Serializable;
import java.util.HashMap;
import java.util.Map;

public class HitRateCalculator {
    public static void main(String[] args) {
        // Create a JavaSparkContext
        JavaSparkContext sc = new JavaSparkContext("local", "HitRateCalculator");

        // Load the onsite attributed data and top frequent queries
        JavaRDD<String> onsiteData = sc.textFile("path/to/onsite_data.txt");
        JavaRDD<String> topQueries = sc.textFile("path/to/top_queries.txt");

        // Convert the top frequent queries to a HashSet for efficient lookup
        final Map<String, Long> cache = new HashMap<>();
        final long cacheExpiration = 12 * 60 * 60 * 1000; // 12 hours in milliseconds

        // Calculate the hit rate
        JavaRDD<Tuple2<String, Boolean>> hitRateData = onsiteData.map(new Function<String, Tuple2<String, Boolean>>() {
            @Override
            public Tuple2<String, Boolean> call(String record) throws Exception {
                String[] fields = record.split(",");
                String query = fields[0];
                long timestamp = Long.parseLong(fields[1]);

                if (topQueries.contains(query)) {
                    Long cachedTimestamp = cache.get(query);
                    if (cachedTimestamp != null && timestamp - cachedTimestamp <= cacheExpiration) {
                        return new Tuple2<>(query, true); // Cache hit
                    } else {
                        cache.put(query, timestamp);
                        return new Tuple2<>(query, false); // Cache miss
                    }
                } else {
                    return new Tuple2<>(query, false); // Not a top frequent query
                }
            }
        });

        // Calculate the hit rate
        Tuple2<Long, Long> hitMissCounts = hitRateData.aggregate(new Tuple2<Long, Long>(0L, 0L),
                new Function2<Tuple2<Long, Long>, Tuple2<String, Boolean>, Tuple2<Long, Long>>() {
                    @Override
                    public Tuple2<Long, Long> call(Tuple2<Long, Long> counts, Tuple2<String, Boolean> record) throws Exception {
                        if (record._2()) {
                            return new Tuple2<>(counts._1() + 1, counts._2());
                        } else {
                            return new Tuple2<>(counts._1(), counts._2() + 1);
                        }
                    }
                },
                new Function2<Tuple2<Long, Long>, Tuple2<Long, Long>, Tuple2<Long, Long>>() {
                    @Override
                    public Tuple2<Long, Long> call(Tuple2<Long, Long> a, Tuple2<Long, Long> b) throws Exception {
                        return new Tuple2<>(a._1() + b._1(), a._2() + b._2());
                    }
                });

        long hitCount = hitMissCounts._1();
        long missCount = hitMissCounts._2();
        double hitRate = (double) hitCount / (hitCount + missCount);

        System.out.println("Hit Count: " + hitCount);
        System.out.println("Miss Count: " + missCount);
        System.out.println("Hit Rate: " + hitRate);

        // Stop the SparkContext
        sc.stop();
    }
}
```

