1. Create a new directory for your extension and navigate to it.

2. Create a file named `manifest.json` with the following content:

```json
{
  "manifest_version": 2,
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "Takes screenshots of the current tab and saves them to the local file system.",
  "permissions": [
    "activeTab",
    "tabs",
    "<all_urls>",
    "storage"
  ],
  "background": {
    "scripts": ["background.js"],
    "persistent": false
  },
  "browser_action": {
    "default_popup": "popup.html"
  }
}
```

3. Create a file named `background.js` with the following content:

```javascript
chrome.browserAction.onClicked.addListener(function(tab) {
  chrome.tabs.captureVisibleTab(null, {format: "png"}, function(dataUrl) {
    var link = document.createElement('a');
    link.download = 'screenshot_' + Date.now() + '.png';
    link.href = dataUrl;
    link.click();
  });
});
```

4. Create a file named `popup.html` with the following content:

```html
<!DOCTYPE html>
<html>
<head>
  <title>Screenshot Extension</title>
</head>
<body>
  <button id="captureButton">Capture Screenshot</button>
  <script src="popup.js"></script>
</body>
</html>
```

5. Create a file named `popup.js` with the following content:

```javascript
document.getElementById('captureButton').addEventListener('click', function() {
  chrome.tabs.query({active: true, currentWindow: true}, function(tabs) {
    chrome.tabs.executeScript(tabs[0].id, {file: 'capture.js'});
  });
});
```

6. Create a file named `capture.js` with the following content:

```javascript
chrome.runtime.sendMessage({action: 'capture'}, function(response) {
  console.log('Screenshot captured');
});
```

